import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { publicRoutes } from './routes';
import { Default  } from './layouts';

function App() {
	return (
		<Router>
			<div>
				<Routes>
					{publicRoutes.map((route, index) => {
						const Page = route.component;
						return (
							<Route
								key={index}
								path={route.path}
								element={
									<Default>
										<Page />
									</Default>
								}
							/>
						);
					})}
				</Routes>
			</div>
		</Router>
	);
}

export default App;
